
def numSubarraysWithSum( nums: list[int], goal: int) -> int:
    left:int = 0
    right:int = 1
    sum_bits:int = 0
    non_empt_subarrays:int = 0

    while right <= len(nums):
        # print(f"nums:{nums[left:right]}, left:{left}, right:{right}")
        # print(f" non_empty:{non_empt_subarrays}, sum:{sum(nums[left:right])}")
        # print(f"left:{left}, right:{right}")
        # print(f"nums slice:{nums[left:right]}")
        # print(len(nums))

        sum_bits = sum(nums[left:right])

        if sum_bits < goal:
            right += 1
            
        if sum_bits == goal:
            # print(f"nums:{nums[left:right]}, left:{left}, right:{right}")
            # print(f"sum_bits:{sum_bits}, goal:{goal}")
            non_empt_subarrays += 1
            right += 1 

            if right == len(nums) + 1:
                print(f"nums:{nums[left:right]}, left:{left}, right:{right}")
                left += 1
                right = left + 1

        if sum_bits > goal:
            left += 1
            right = left + 1
    
    return non_empt_subarrays


    

